window.phet.chipper.strings = {"en":{"MY_SOLAR_SYSTEM/screen.intro":"‪Intro‬","MY_SOLAR_SYSTEM/screen.lab":"‪Lab‬","MY_SOLAR_SYSTEM/a11y.introScreen.screenSummary.playAreaDescription":"‪The Play Area is an observation window showing a scene with two planetary bodies. Experiment with the mass, velocity, location and direction of the two planetary bodies.‬","MY_SOLAR_SYSTEM/a11y.introScreen.screenSummary.controlAreaDescription":"‪In the Control Area, there are options to add a grid and a measuring tape. You can also toggle on or off the path and values of your planetary bodies and also check their center of mass. The Control Area has options for how fast the action happens in the observation window including buttons to pause and step forward.‬","MY_SOLAR_SYSTEM/a11y.labScreen.screenSummary.playAreaDescription":"‪The Play Area is an observation window showing a scene with many options to set up your own experiments. Recreate our own Sun and Earth or make up your own solar system.‬","MY_SOLAR_SYSTEM/a11y.labScreen.screenSummary.controlAreaDescription":"‪In the Control Area, there are options to view and change the area of the orbit and options to adjust and view orbital information. You can choose premade planetary alignments or choose your own, along with a Zoom in and out option. The Control Area has options for how fast the action happens in the observation window including buttons to pause and step forward.‬","MY_SOLAR_SYSTEM/followCenterOfMass":"‪Follow Center of Mass‬","MY_SOLAR_SYSTEM/dataPanel.bodies":"‪Bodies‬","MY_SOLAR_SYSTEM/a11y.numberOfBodies":"‪Number of Bodies‬","MY_SOLAR_SYSTEM/dataPanel.moreData":"‪More Data‬","MY_SOLAR_SYSTEM/a11y.moreData":"‪More Data‬","MY_SOLAR_SYSTEM/a11y.info":"‪Info‬","MY_SOLAR_SYSTEM/unitsInfo.content":"‪<b>Note 1:</b> An Astronomical Unit (AU) is about 150 million kilometers. This is the average distance between the Sun and the Earth.‬","MY_SOLAR_SYSTEM/unitsInfo.content2":"‪<b>Note 2:</b> The mass values in this simulation range from 1 Jupiter mass to 1.5 Solar masses. All astronomical objects show a similar behavior under a strong gravitational field, including smaller planets, comets, and asteroids.‬","MY_SOLAR_SYSTEM/unitsInfo.content3":"‪<b>Note 3:</b> Due to the large range of values in the simulation, the gravity force vectors may sometimes be too small or too large to display. The gravity force vectors can be rescaled with the zoom control.‬","MY_SOLAR_SYSTEM/unitsInfo.title":"‪Units Information‬","MY_SOLAR_SYSTEM/returnBodies":"‪Return Bodies‬","MY_SOLAR_SYSTEM/pattern.labelParenthesesUnits":"‪{{label}} ({{units}})‬","MY_SOLAR_SYSTEM/mass":"‪Mass‬","MY_SOLAR_SYSTEM/dataPanel.mass":"‪Mass‬","MY_SOLAR_SYSTEM/units.kg":"‪10<sup>28</sup> kg‬","MY_SOLAR_SYSTEM/dataPanel.position":"‪Position‬","MY_SOLAR_SYSTEM/dataPanel.velocity":"‪Velocity‬","MY_SOLAR_SYSTEM/a11y.labScreen.modeSelector":"‪Mode Selector‬","MY_SOLAR_SYSTEM/mode.sunAndPlanet":"‪Sun, Planet‬","MY_SOLAR_SYSTEM/mode.sunPlanetAndMoon":"‪Sun, Planet, Moon‬","MY_SOLAR_SYSTEM/mode.sunPlanetAndComet":"‪Sun, Planet, Comet‬","MY_SOLAR_SYSTEM/mode.trojanAsteroids":"‪Trojan Asteroids‬","MY_SOLAR_SYSTEM/mode.ellipses":"‪Ellipses‬","MY_SOLAR_SYSTEM/mode.hyperbolic":"‪Hyperbolic‬","MY_SOLAR_SYSTEM/mode.slingshot":"‪Slingshot‬","MY_SOLAR_SYSTEM/mode.doubleSlingshot":"‪Double Slingshot‬","MY_SOLAR_SYSTEM/mode.binaryStarPlanet":"‪Binary Star, Planet‬","MY_SOLAR_SYSTEM/mode.fourStarBallet":"‪Four Star Ballet‬","MY_SOLAR_SYSTEM/mode.doubleDouble":"‪Double Double‬","MY_SOLAR_SYSTEM/mode.custom":"‪Custom‬","MY_SOLAR_SYSTEM/centerOfMass":"‪Center of Mass‬","MY_SOLAR_SYSTEM/dataPanel.X":"‪x‬","MY_SOLAR_SYSTEM/dataPanel.Y":"‪y‬","MY_SOLAR_SYSTEM/dataPanel.Vx":"‪V<sub>x</sub>‬","MY_SOLAR_SYSTEM/dataPanel.Vy":"‪V<sub>y</sub>‬","MY_SOLAR_SYSTEM/pattern.range":"‪{{min}} to {{max}}‬","MY_SOLAR_SYSTEM/my-solar-system.title":"‪My Solar System‬","JOIST/simTitleWithScreenNamePattern":"‪{{simName}} — {{screenName}}‬","JOIST/a11y.screenNamePattern":"‪{{na
